import classes from "./DailyVariablesTab.module.css";

const DailyVariablesTab = (props) => {
  const [selectedCheckboxes, setSelectedCheckboxes] = useState([]);

  const handleCheckBoxChange = (event) => {
    if (event.target.checked) {
      const newSelectedCheckboxes = [...selectedCheckboxes, event.target.id];
      setSelectedCheckboxes(newSelectedCheckboxes);
    } else {
      const newSelectedCheckboxes = selectedCheckboxes.filter((id) => {
        return id !== event.target.id;
      });
      setSelectedCheckboxes(newSelectedCheckboxes);
    }
  };
  
  console.log(selectedCheckboxes);

  return (
    <>
      <h3>Daily weather variables</h3>
      <div className={classes.variables}>
        <span>
          <input
            type="checkbox"
            id="weatherCode"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="weatherCode">Weathercode (2m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="precipationSum"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="precipationSum">Precipation Sum</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="maxTemp2m"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="maxTemp2m">Maximum Temperature (2m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="precipationHours"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="precipationHours">Precipation Hours</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="minTemp2m"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="minTemp2m">Minimum Temperature (2m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="maxWindSpeed10m"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="maxWindSpeed10m">Maximum Wind Speed (10m)</label>
        </span>
        <span>
          <input
            type="checkbox"
            id="maxAppTemp2m"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="maxAppTemp2m">
            Maximum Apparent Temperature (2m)
          </label>
        </span>
        <span>
          <input
            type="checkbox"
            id="maxWindGusts"
            onChange={handleCheckBoxChange}
          />
          <label htmlFor="maxWindGusts">Maximum Wind Gusts (10m)</label>
        </span>
      </div>
    </>
  );
};

export default DailyVariablesTab;
